  const businesses = useSelector(state => Object.values(state.businesses))

  useEffect(() => {
    dispatch(getBusinesses());
  }, [dispatch]);

  return (
    <div>
        <div>
            {businesses.map((business) => {
                console.log(business)
                return business
            })}
        </div>
    </div>
  );
};

export default Businesses;
